div.wpforms-container .wpforms-form .wpforms-page-button,
.o-button--secondary {
  @include o-button;
  @include o-button--secondary;
}

/**
 * Button Tertiary
 */
@mixin o-button--teritary {
  color: $c-primary;
  background: linear-gradient(to left, transparent 50%, $c-primary 50%);
  background-size: 200% 100%;
  background-position: right bottom;

  &:hover,
  &:focus {
    color: $c-white;
    border-color: $c-primary;
    background-position: left bottom;
  }
}

.o-button--teritary {
  @include o-button;
  @include o-button--teritary;
}


button,
input[type="submit"],
.o-button,
.o-form div.wpforms-container .wpforms-form button[type=submit],
div.wpforms-container .wpforms-form button[type=submit] {
  @include o-button;
  @include o-button--primary;
}
","/* ------------------------------------ *\
    $ICONS
\* ------------------------------------ */

.o-icon {
  display: inline-block;
}

.o-icon--xs svg {
  width: $icon-xsmall;
  height: $icon-xsmall;
  min-width: $icon-xsmall;
}

.o-icon--s svg {
  width: 18px;
  height: 18px;
  min-width: 18px;

  @include media('>small') {
    width: $icon-small;
    height: $icon-small;
    min-width: $icon-small;
  }
}

.o-icon--m svg {
  width: $icon-medium;
  height: $icon-medium;
  min-width: $icon-medium;
}

.o-icon--l svg {
  width: $icon-large;
  height: $icon-large;
  min-width: $icon-large;
}

.o-icon--xl svg {
  width: $icon-xlarge;
  height: $icon-xlarge;
  min-width: $icon-xlarge;
}
","/* ------------------------------------ *\
    $IMAGES
\* ------------------------------------ */

img,
video,
object,
svg,
iframe {
  max-width: 100%;
  border: none;
  display: block;
}

img {
  height: auto;
}

svg {
  max-height: 100%;
}

picture,
picture img {
  display: block;
}

figure {
  position: relative;
  display: inline-block;
  overflow: hidden;
}

figcaption {
  a {
    display: block;
  }
}
","/* ------------------------------------ *\
    $TEXT
\* ------------------------------------ */

p {
  @include p;
}

small {
  font-size: 90%;
}

/**
 * Bold
 */
strong,
b {
  font-weight: bold;
}

/**
 * Blockquote
 */
blockquote {
  display: flex;
  flex-wrap: wrap;

  &::before {
    content: "\201C";
    font-family: $ff-font;
    font-size: 40px;
    line-height: 1;
    color: $c-secondary;
    min-width: 40px;
    border-right: 6px solid $c-border;
    display: block;
    margin-right: $space;
  }

  p {
    line-height: 1.7;
    flex: 1;
  }
}

/**
 * Horizontal Rule
 */
hr {
  height: 1px;
  border: none;
  background-color: rgba($c-gray--light, 0.5);
  margin: 0 auto;
}

.o-hr--small {
  border: 0;
  width: 100px;
  height: 2px;
  background-color: $c-black;
  margin-left: 0;
}

/**
 * Abbreviation
 */
abbr {
  border-bottom: 1px dotted $c-gray;
  cursor: help;
}

/**
 * Eyebrow
 */
.o-eyebrow {
  padding: 0 $space-quarter;
  background-color: $c-black;
  color: $c-white;
  border-radius: $border-radius;
  display: inline-flex;
  line-height: 1;

  @include o-heading--xs;
}

/**
 * Page title
 */
.o-page-title {
  text-align: center;
}

/**
 * Intro
 */
.o-intro,
.o-intro p {
  font-size: $font-size-l;
  line-height: 1.6;
}

/**
 * Kicker
 */
.o-kicker {
  @include o-heading--m;
  font-weight: bold;
  color: $c-primary;
}

/**
 * Rich text editor text
 */
.o-rte-text {
  width: 100%;
  max-width: 100%;
  margin-left: auto;
  margin-right: auto;

  @include p;

  & > * + * {
    margin-top: $space;
  }

  > *:not(.o-section) {
    max-width: $large;
    margin-left: auto;
    margin-right: auto;
  }

  > dl dd,
  > dl dt,
  > ol li,
  > ul li,
  > p {
    @include p;
  }

  h2:empty,
  h3:empty,
  p:empty {
    display: none;
  }

  > h1,
  > h2,
  > h3 {
    padding-top: $space;
  }

  > h4 {
    margin-bottom: -$space-half;
  }

  .wp-block-button__link {
    @include o-button;
    @include o-button--primary;
  }

  hr {
    margin-top: $space-double;
    margin-bottom: $space-double;
  }

  hr.o-hr--small {
    margin-top: $space;
    margin-bottom: $space;
  }

  code,
  pre {
    font-size: 125%;
  }
}

label,
.o-form div.wpforms-container-full .wpforms-form .wpforms-field-label,
div.wpforms-container-full .wpforms-form .wpforms-field-label {
  @include o-heading--xs;
}
","/* ------------------------------------ *\
    $SPECIFIC FORMS
\* ------------------------------------ */

/* Social Links */
.c-social-links {
  display: flex;
  align-items: center;
  justify-content: center;

  &__item {
    padding: $space-half;
    border-radius: 40px;
    margin: 0 $space-half;
    background-color: $c-primary;

    svg path {
      transition: $transition-all;
      fill: $c-white;
    }
  }
}
","/* ------------------------------------ *\
    $NAVIGATION
\* ------------------------------------ */

/**
 * Drawer menu
 */
.l-body.menu-is-active {
  overflow: hidden;

  &::before {
    opacity: 1;
    visibility: visible;
    z-index: 9998;

    @include media(">xlarge") {
      opacity: 0;
      visibility: hidden;
    }
  }

  .c-nav-drawer {
    right: 0;

    @include media(">xlarge") {
      right: -400px;
    }
  }
}

.c-nav-drawer {
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  width: 100%;
  height: 100vh;
  max-width: 400px;
  background-color: $c-white;
  position: fixed;
  z-index: 9999;
  top: 0;
  right: -400px;
  transition: right 0.25s $transition-effect;

  @include media(">xlarge") {
    display: none;
  }

  &__toggle {
    background-color: transparent;
    justify-content: flex-start;
    padding: $space;
    outline: 0;
    border: 0;
    border-radius: 0;
    background-image: none;

    .o-icon {
      transition: transform 0.25s $transition-effect;
      transform: scale(1);
    }

    &:hover,
    &:focus {
      .o-icon {
        transform: scale(1.1);
      }
    }
  }

  &__nav {
    height: 100%;
    padding-top: $space-double;
  }

  &__social {
    border-top: $border--standard-light;

    .c-social-links {
      justify-content: space-evenly;

      &__item {
        border: 0;
        border-radius: 0;
        background: none;
        margin: 0;

        svg path {
          fill: $c-gray--light;
        }

        &:hover,
        &:focus {
          svg path {
            fill: $c-primary;
          }
        }
      }
    }
  }
}

/**
 * Primary nav
 */
.c-nav-primary {
  &__menu-item {
    margin: 0 $space-double;

    @include media(">xlarge") {
      margin: 0 $space;

      &:last-child {
        margin-right: 0;
      }
    }
  }

  &__list {
    display: flex;
    flex-direction: column;
    align-items: stretch;
    justify-content: flex-start;

    @include media(">xlarge") {
      flex-direction: row;
      align-items: center;
      justify-content: flex-end;
    }
  }

  &__menu-item:not(.button) a {
    width: 100%;
    padding: $space 0;
    border-bottom: $border--standard-light;
    color: $c-black;
    display: flex;
    align-items: center;
    justify-content: space-between;

    @include o-heading--s;

    @include media(">xlarge") {
      width: 100%;
      padding: $space-quarter 0;
      display: flex;
      align-items: center;
      justify-content: space-between;
      color: $c-black;
      border-bottom: 1px solid transparent;
      text-align: center;
    }


    &:hover,
    &:focus {
      color: $c-black;

      @include media(">xlarge") {
        border-bottom: 1px solid $c-black;
      }


      &::after {
        opacity: 1;
        visibility: visible;
        left: 0;
      }
    }

    &::after {
      opacity: 0;
      visibility: hidden;
      content: "";
      color: $c-gray--light;
      font-size: 22px;
      line-height: 1;
      transition: $transition-all;
      position: relative;
      left: -10px;
      transition-delay: 0.25s;

      @include media(">xlarge") {
        display: none;
      }
    }
  }

  &__menu-item.button a {
    @include o-button;
    @include o-button--secondary;

    @include media("<=xlarge") {
      margin-top: $space;
      width: 100%;
    }


    &::after {
      display: none;
    }
  }
}

/**
 * Utility nav
 */
.c-nav-utility {
  display: flex;
  flex-direction: column;
  align-items: stretch;
  justify-content: stretch;
  margin: $space-double;

  @include media(">medium") {
    flex-direction: row;
    align-items: center;
    justify-content: flex-end;
    margin: 0 (-$space-half);
  }


  &__link {
    @include o-heading--xs;

    color: $c-primary;
    padding: $space-half 0;
    position: relative;

    @include media(">medium") {
      color: $c-white;
      padding: 0 $space-half;
      height: 100%;
      line-height: 40px;
    }


    &:hover,
    &:focus {
      color: $c-black;

      @include media(">medium") {
        color: $c-white;

        &::after {
          background-color: $c-secondary;
        }
      }
    }

    &::after {
      content: "";
      display: block;
      width: 100%;
      height: 100%;
      background-color: transparent;
      position: absolute;
      top: 0;
      left: 0;
      z-index: -1;
      transform: skewX(-20deg);
      transition: $transition-all;
      pointer-events: none;
    }
  }
}

/**
 * Footer nav
 */
.c-nav-footer {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  text-align: center;
  margin-bottom: -$space-half;

  &__link {
    color: $c-white;
    padding: $space-half;
    border-radius: 50px;

    @include o-heading--xs;

    &:hover,
    &:focus {
      color: $c-white;
      background-color: $c-primary;
    }
  }
}

/**
 * Footer legal nav
 */
.c-nav-footer-legal {
  display: flex;
  align-items: center;
  justify-content: center;
  margin-left: -$space-half;
  margin-right: -$space-half;

  @include media(">medium") {
    justify-content: flex-end;
  }


  &__link {
    color: $c-white;
    padding: $space-quarter $space-half;
    text-decoration: underline;

    &:hover,
    &:focus {
      color: $c-white;
    }
  }
}
