","/* ------------------------------------ *\
    $HEADER
\* ------------------------------------ */

#wpadminbar {
  position: fixed;
  z-index: 10;

  #wp-admin-bar-root-default {
    #wp-admin-bar-customize,
    #wp-admin-bar-comments,
    #wp-admin-bar-wpseo-menu {
      display: none;
    }
  }
}

.logged-in .c-utility {
  top: 0;

  @include media(">782px") {
    top: 32px;
  }
}

.c-utility {
  position: relative;
  top: 0;
  z-index: 9;
  height: 40px;
  background: $c-primary;

  @include media(">medium") {
    position: sticky;
  }


  &--inner {
    display: flex;
    align-items: stretch;
    justify-content: space-between;
  }

  &__nav {
    @include media("<=medium") {
      display: none;
    }
  }

  &__social {
    position: relative;
    left: -$space-half;

    a {
      border: 0;
      border-radius: 0;
      background: none;
      margin: 0;

      svg path {
        fill: $c-white;
      }

      &:hover,
      &:focus {
        background-color: $c-secondary;

        svg path {
          fill: $c-white;
        }
      }
    }
  }
}

.c-header {
  border-bottom: $border--standard-light;
  background-color: $c-white;

  &--inner {
    display: flex;
    align-items: center;
    justify-content: space-between;
  }

  &__logo {
    display: flex;
    align-items: center;
    max-width: 240px;
    padding: $space 0;

    img {
      width: 100%;
    }
  }

  &__nav {
    display: flex;
    align-items: center;
    justify-content: center;

    .c-nav-primary {
      display: none;

      @include media(">xlarge") {
        display: flex;
      }
    }

    .o-toggle {
      border-radius: 0;
      background: none;
      border: 0;
      position: relative;
      right: -$space;

      @include media(">xlarge") {
        display: none;
      }
    }
  }
}

/* ------------------------------------ *\
    $FOOTER
\* ------------------------------------ */

.c-footer {
  position: relative;
  z-index: 1;
  background-color: $c-secondary;
  font-weight: bold;
  margin-top: $space-quad;

  &-main {
    padding: $space-double 0;

    &__contact {
      a {
        color: $c-black;

        &:hover,
        &:focus {
          text-decoration: underline;
        }
      }
    }
  }

  &-legal {
    background-color: $c-primary;
    color: $c-white;
    width: 100%;
    font-size: $font-size-xs;

    .c-footer--inner {
      padding: $space-quarter $space;
      grid-row-gap: 0;
    }

    &__copyright {
      text-align: center;

      @include media(">medium") {
        text-align: left;
      }
    }

    &__nav {
      @include media(">medium") {
        text-align: right;
      }
    }
  }
}
","/* ------------------------------------ *\
    $PAGE SECTIONS
\* ------------------------------------ */

.o-section {
  padding-top: $space-quad;
  padding-bottom: $space-quad;
  margin-left: -$space;
  margin-right: -$space;

  @include media(">xlarge") {
    margin-left: -$space-double;
    margin-right: -$space-double;
  }


  &:first-child {
    padding-top: 0;
  }
}

/**
 * Hero
 */
.c-section-hero {
  position: relative;
  overflow: hidden;
  margin-top: 0;
  margin-bottom: $space-quad;

  &--inner {
    @include media("<=medium") {
      grid-column-gap: 0;
    }
  }

  &::before {
    content: "";
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    width: 100%;
    transform: skew(-35deg);
    transform-origin: top;
    background-color: rgba($c-secondary, 0.2);
  }

  &.o-section {
    padding-top: $space-quad;
  }

  &__body {
    display: flex;
    flex-direction: column;
    justify-content: center;
  }

  &__button {
    align-self: flex-start;
  }

  &__image {
    display: table;

    img {
      box-shadow: $box-shadow--thick;
    }

    svg {
      max-width: 400px;
      margin-left: auto;
      margin-right: auto;
    }
  }
}

/**
 * Banner
 */
.c-section-banner {
  padding-left: $space;
  padding-right: $space;
  position: relative;

  &--inner {
    background-color: rgba($c-secondary, 0.2);
    border-radius: 50px;
    padding: $space-double;

    @include media(">large") {
      border-radius: 100px;
    }
  }

  &__body {
    display: flex;
    flex-direction: column;
    justify-content: center;
    padding-top: $space;

    @include media(">large") {
      padding-bottom: $space;
    }
  }

  &__button {
    align-self: flex-start;
  }

  &__image {
    position: relative;
    height: auto;
    display: block;
    align-self: center;
    justify-content: flex-end;

    @include media("<=xxlarge") {
      transform: scale(0.8) !important;
    }


    @include media(">large") {
      left: calc(50% + #{$space-quad});
      position: absolute;
      top: 0;
    }


    @include media(">xxlarge") {
      transform: scale(1);
      right: -160px;
      left: auto;
    }


    picture {
      border-radius: 50%;
      overflow: hidden;
      z-index: 1;
      position: relative;
      border: 5vw solid $c-primary;
      width: 75%;
      height: 75%;
      margin-left: auto;
      margin-right: auto;

      @include media(">large") {
        width: 600px;
        height: 600px;
        min-width: 600px;
        margin-left: 0;
        border-width: 40px;
      }
    }

    &::before {
      content: "";
      display: none;
      background-color: $c-primary;
      height: 100%;
      width: 50vw;
      position: absolute;
      left: 50%;
      top: 0;
      z-index: 0;

      @include media(">large") {
        display: none;
      }
    }

    &::after {
      content: "";
      display: block;
      height: 100%;
      width: 100%;
      position: absolute;
      z-index: 0;
      border-left: 50vw solid transparent;
      border-right: 50vw solid transparent;
      border-top: 60vw solid $c-primary;
      transform: translate(-50%, 0);
      left: 50%;
      top: 50%;

      @include media(">large") {
        border-top: 400px solid transparent;
        border-bottom: 400px solid transparent;
        border-right: 460px solid $c-primary;
        border-left: none;
        transform: translate(0, -50%);
        left: -50%;
        top: 50%;
      }
    }
  }
}

/**
 * Cards
 */
.c-section-cards {
  &__buttons {
    display: flex;
    align-items: center;
    justify-content: center;

    a {
      margin: 0 $space-half;
    }

    a:last-child {
      @include o-button--teritary;
    }
  }

  .c-cards {
    grid-column-gap: 0;

    @include media(">medium") {
      grid-column-gap: $space-double;
    }
  }

  .c-card {
    display: flex;
    align-items: center;
    flex-direction: column;
    background-color: $c-white;
    border-radius: $border-radius--large;
    padding: $space;
    text-align: center;

    picture {
      display: block;
      overflow: hidden;
      border-radius: 50%;
    }

    &__description {
      flex: 1;
    }
  }
}

